Население Малайзии на июль 2010 года составляет 28 250 500 человек (44-е место в мире). Из них 5,72 миллиона проживает в Восточной Малайзии, а 22,5 миллиона — в полуостровной части страны. По среднему прогнозу, население страны к 2100 году составит — 37,7 млн человек. 
* Малайцы и 
* другие бумипутра составляют 65 % населения; 
* китайцы — 26 %; 
* индийцы — 7,1 % и 
* другие этнические группы — 1 %.

